import { useState } from 'react';
import Navbar from './Navbar.js'

import {Button , Card } from 'react-bootstrap';
import '../node_modules/font-awesome/css/font-awesome.min.css'; 
import Dog from './dog.png'
const Team = () => {
    const [team, setTeam] = useState([
        { name: 'Omkaar', position: 'Chief Exec Officer' },
        { name: 'Andrew', position: 'Team Member' }

    ])
    return (

        <div>
            <Navbar />

            <div className='content' >

                <div className="AboutUs">

                    <h1>The Memory Glass Team</h1>

                    {team.map((team) => (

                        <div className="team">

                                <Card style={{ width: '18rem' }}>
                                    <Card.Img variant="top" src={Dog} style={{borderRadius: '50%'}}/>
                                    <Card.Body>
                                        <Card.Title><h2>{team.name}</h2></Card.Title>
                                        <Card.Text style={{ marginTop:'-20px'}}>
                                            <h3>{team.position}</h3>
                                        </Card.Text>
                                        <Button variant="primary" style={{position: 'absolute', left: '45%', top: '90%',}}><i className="fa fa-envelope"/>

</Button>
                                    </Card.Body>
                                </Card>




                        </div>


                    ))}
                </div>
            </div>
        </div>
    );
}

export default Team;
